import React from 'react'
import Breadcrumb from '../components/Breadcrumb'

const Details = () => {
  return (
    <main className="pt-8 pb-16">
        {/* top container */}
        <div>
            <div className="max-w-[1320px] w-full px-3 mx-auto">
                <Breadcrumb/>
            </div>
        </div>
    </main>
  )
}

export default Details
